import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "../css/exam.css";
import { Navbar, Footer } from "./CommonUI";

const dummyQuestions = [
  {
    question: "What is 2 + 2?",
    options: ["1", "2", "3", "4"],
  },
  {
    question: "Which color is the sky?",
    options: ["Red", "Blue", "Green", "Yellow"],
  },
  {
    question: "What is the capital of India?",
    options: ["Delhi", "Mumbai", "Chennai", "Kolkata"],
  },
  {
    question: "What is 5 x 5?",
    options: ["10", "20", "25", "30"],
  },
  {
    question: "Which animal barks?",
    options: ["Cat", "Dog", "Cow", "Lion"],
  },
  {
    question: "What is the square root of 81?",
    options: ["7", "8", "9", "10"],
  },
  {
    question: "Which planet is known as the Red Planet?",
    options: ["Earth", "Venus", "Mars", "Jupiter"],
  },
  {
    question: "Who wrote Hamlet?",
    options: ["Shakespeare", "Dickens", "Tolkien", "Rowling"],
  },
  {
    question: "What is H2O?",
    options: ["Oxygen", "Hydrogen", "Water", "Helium"],
  },
  {
    question: "Which is a programming language?",
    options: ["HTML", "CSS", "Python", "Photoshop"],
  },
];

const Exam = () => {
  const navigate = useNavigate();
  const [showInstructions, setShowInstructions] = useState(true);
  const [timeLeft, setTimeLeft] = useState(30); // 30 seconds timer
  const [showQuestions, setShowQuestions] = useState(false);

  // Timer countdown
  useEffect(() => {
    if (showQuestions && timeLeft > 0) {
      const timer = setInterval(() => {
        setTimeLeft((prev) => prev - 1);
      }, 1000);
      return () => clearInterval(timer);
    } else if (timeLeft === 0) {
      alert("Time's up! Exam ended.");
      setShowQuestions(false);
    }
  }, [showQuestions, timeLeft]);

  const handleStartExam = () => {
    setShowInstructions(false);
    setShowQuestions(true);
  };

  const handleSubmit = () => {
    alert("Exam submitted!");
    navigate("/"); // Redirect to home after submission
  };

  return (
    <div className="exam-page">
      <Navbar isLoggedIn={true} />

      {showInstructions ? (
        <div className="instructions-popup">
          <h2>Exam Instructions</h2>
          <ul>
            <li>Total Questions: 10</li>
            <li>Each question is multiple-choice (MCQ)</li>
            <li>Time limit: 30 seconds</li>
            <li>Click Submit to end the exam</li>
          </ul>
          <button className="ok-btn" onClick={handleStartExam}>
            OK
          </button>
        </div>
      ) : showQuestions ? (
        <div className="exam-questions">
          <div className="timer">Time Remaining: {timeLeft} sec</div>

          {dummyQuestions.map((q, idx) => (
            <div key={idx} className="question-card">
              <h4>
                {idx + 1}. {q.question}
              </h4>
              <div className="options">
                {q.options.map((opt, i) => (
                  <label key={i}>
                    <input type="radio" name={`q${idx}`} />
                    {opt}
                  </label>
                ))}
              </div>
            </div>
          ))}

          <button className="submit-btn" onClick={handleSubmit}>
            Submit
          </button>
        </div>
      ) : (
        <div className="exam-ended">
          <h2>Exam Ended!</h2>
          <button onClick={() => navigate("/")}>Go Home</button>
        </div>
      )}

      <Footer />
    </div>
  );
};

export default Exam;
